  let photos = results.map(photo =>
    <Photo url={'https://live.staticflickr.com/'+photo.server+'/'+photo.id+'_'+ photo.secret +'_'+'.jpg'}/>
  );

  return (
    <div className="photo-container">
      <h2>Results</h2>
